description:
From Wikipedia: &quot;The Uneventful Vacation is an album released by indie rock band Commander Venus in 1997. The album was recorded during the summer of the band's freshman year in high school. Despite the album being rushed into recording over summer vacation, and the band experiencing tension between themselves and their producer, the album was considered a mild success, and gained popularity over college airplay. Fans of the album claimed that Commander Venus could be &quot;the next big thing&quot; out of Omaha. The Uneventful Vacation continues to gain popularity even today as fans of Bright Eyes discover Conor Oberst's older material.&quot;



   1. &quot;Jean's T.V.&quot;
   2. &quot;Refused By Light&quot;
   3. &quot;We'll Always Have Paris&quot;
   4. &quot;The Uneventful Vacation (Part I)&quot;
   5. &quot;Lock N' Chase&quot;
   6. &quot;Life As Expected&quot;
   7. &quot;The Way Things Had to Be&quot;
   8. &quot;Dress to Please&quot;
   9. &quot;Walk-Around Problem&quot;
  10. &quot;My Collapsing Frame&quot;
  11. &quot;The Raining Holiday (Part II)&quot;
  12. &quot;The Role of the Hero in Antiquity&quot;

Quality is 320kbps. Includes some scans of the CD art, disc art and lyrics booklet. 



This album is amazing, and any fan of Bright Eyes/Conor Oberst should check it out. If you'd like to support the guys, their current groups are fantastic as well; Conor Oberst and the Mystic Valley Band, Monsters of Folk, Cursive, and The Faint. 

Enjoy :)
